import React from 'react'; // Import React
import "./project.css";
function Project(projectData) {
  const { imageUrl, title } = projectData; // Destructuring
console.log("image ",imageUrl);
  return (
    <div className="project">
      <img src={imageUrl}  onError={(event) => {
        event.target.src = './assets/logo.png'; // Fallback image
      }} />
      <h3>{title}</h3>
    </div>
  );
}

export default Project;
